import React from "react";

class Form extends React.Component {
  render() {
    return (
      <form>
        <label htmlFor="name">
          Nome:
          <input type="text" data-testid="description-input" name="name" />
        </label>
        <label htmlFor="description">Descrição
          <input type="textarea" data-testid="description-input" name="description"/>
        </label>
      </form>
    );
  }
}

export default Form;
